    #         memo={0:1}
    #         if dp(word,len(word))>1:
    #             ans.append(word)
    #     return ans

    # solution 2 dfs 352 ms
    def findAllConcatenatedWordsInADict(self, words):
        def dfs(word,initial,memo):
            if word in memo:
                return memo[word]
            if word in wordDict and not initial:
                memo[word]=1
                return True
            for i in range(1,len(word)):
                if word[:i] in wordDict and dfs(word[i:],False,memo):
                    memo[word]=1
                    return True
            memo[word]=0
            return False

        wordDict=set(words)
        ans=[]
        for word in words:
            if dfs(word,True,{}):
                ans.append(word)
        return ans


